import React, {useState, useEffect}  from 'react'; 
function Test() { 
    const [click, setClick] = useState(0); 
    const [count, setCount] = useState(0); 

    useEffect(
        () => {
            setTimeout(
                () => {
                    setClick(click + 1)
                },1000
            );
        },[count]
    );

    return ( 
        <div> 
            <p>You clicked {click} times</p> 

            <button onClick = { () => setClick(count + 1) } > 
                Click me 
            </button> 
        </div> 
    ); 
} 
export default Test;
